import React, { useState } from 'react';
import { Container, Row } from 'react-bootstrap';
import placeholder from '../../images/750x500.png';

const Banner = () => {
    return (
    <Container fluid>
        <Row>
        <img src={placeholder} className='text-center' alt="placeholder" />
        </Row>
    </Container>)
}

export default Banner;
